ISLAMABAD, Dec 09 (APP): Deputy Prime Minister/Foreign Minister Mohammad Ishaq Dar on Monday received Egyptian candidate for Director General UNESCO, Dr. Khaled El-Enany.
“They reaffirmed the historic brotherly ties between Pakistan and Egypt and strong commitment to strengthening these relations. Deputy Prime Minister Dar and Dr. El-Enany discussed the importance of cultural exchanges and cooperation in multilateral platforms including UNESCO,” Foreign Office posted on X handle.
